import React from 'react'

function Card({ Series }) {
    return (

        <div className="container">

            {Series.map(Serie => (
                < div className="Card">
                    <img src={Serie.url} style={{ width: "400px" }} alt="Pic of the Serie" />
                    <div className="info">
                        <h2 key={Serie.Lst}> {Serie.id} {" : "}{Serie.title}  </h2>

                    </div>
                </div>

            ))}


        </div>

    )
}

export default Card
